import React from 'react';
import "../../css/Views/waiting.css"
import Footer from '../Components/Footer';
import Header from '../Components/Header';

 class Waiting extends React.Component {

    constructor(props){
        super(props)
        this.state={
            inKey:false
        }
    }

    componentDidMount(){
        // setTimeout(() =>
        // this.setState({inKey:true}),5000)
    }



    render() {
      return (
        <div id="waiting">
            {this.state.inKey && <><Header waiting={true}/>
            <div id="footerBlockWait">
                    <p className="footerTxt">Tous droits réservés</p>
                    <p className="footerTxt">Baptiste MARTY & David ANDREAN</p>
                    <p className="footerTxt">Copyright @</p>
            </div></>}
            <div id="titleWaitingBlock">
                <p id="titleWaiting">Les Cités des Secrets</p>
            </div>
            <div id="keyBlock">
                <img id="key" src='img\Key.png' alt="clé"/>
            </div>
            {!this.state.inKey && <div id="footerBlockWait">
                    <p className="footerTxtWait">Tous droits réservés</p>
                    <p className="footerTxtWait">Baptiste MARTY & David ANDREAN</p>
                    <p className="footerTxtWait">Copyright @</p>
            </div>}
            <div id="yellowBack">

            </div>
        </div>
      )
    }
  }

  export default Waiting
